patch:
diff --git a/src/change.c b/src/change.c
index daf4faed5..7dcd06780 100644
--- a/src/change.c
+++ b/src/change.c
@@ -1118,19 +1118,33 @@ ins_char_bytes(char_u *buf, int charlen)
 	}
     }

-    newp = alloc(linelen + newlen - oldlen);
+    // Calculate the new line length: max(col, linelen - 1) + newlen - oldlen + 1 (for NUL)
+    int old_line_len = linelen - 1; // exclude NUL
+    int before_len = (col > old_line_len) ? col : old_line_len;
+    int after_len = (old_line_len > col + oldlen) ? (old_line_len - (col + oldlen)) : 0;
+    int new_line_len = col + newlen + after_len + 1;
+    newp = alloc(new_line_len);
     if (newp == NULL)
 	return;

     // Copy bytes before the cursor.
-    if (col > 0)
-	mch_memmove(newp, oldp, (size_t)col);
+    if (col > 0) {
+        int copylen = (col > old_line_len) ? old_line_len : col;
+        if (copylen > 0)
+            mch_memmove(newp, oldp, (size_t)copylen);
+        // If cursor is past end of line, fill gap with spaces
+        for (int j = copylen; j < col; ++j)
+            newp[j] = ' ';
+    }

     // Copy bytes after the changed character(s).
     p = newp + col;
-    if (linelen > col + oldlen)
-	mch_memmove(p + newlen, oldp + col + oldlen,
-					    (size_t)(linelen - col - oldlen));
+    int after_start = col + oldlen;
+    int afterlen = (old_line_len > after_start) ? (old_line_len - after_start) : 0;
+    if (afterlen > 0)
+        mch_memmove(p + newlen, oldp + after_start, (size_t)afterlen);
+    // NUL terminate
+    newp[new_line_len - 1] = NUL;

     // Insert or overwrite the new character.
     mch_memmove(p, buf, charlen);
